  \"Towards A Model-Based Prognostics Methodology For Electrolytic Capacitors: A Case
  Study Based On Electrical Overstress Accelerated Aging\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:04:04.994822\",\n\t\"name\": \"towards-a-model-based-prognostics-methodology-for-electrolytic-capacitors-a-case-study-bas-e79f3\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This paper presents a model-driven methodology
  for predict- ing the remaining useful life of electrolytic capacitors. This methodology
  adopts a Kalman filter approach in conjunction with an empirical state-based degradation
  model to predict the degradation of capacitor parameters through the life of the
  capacitor. Electrolytic capacitors are important components of systems that range
  from power supplies on critical avion- ics equipment to power drivers for electro-mechanical
  actuators. These devices are known for their comparatively low reliability and given
  their critical role in the system, they are good candidates for component level
  prognostics and health management. Prognostics provides a way to assess remain-
  ing useful life of a capacitor based on its current state of health and its anticipated
  future usage and operational conditions. This paper proposes and empirical degradation
  model and discusses experimental results for an accelerated aging test performed
  on a set of identical capacitors subjected to electrical stress. The data forms
  the basis for developing the Kalman-filter based remaining life prediction algorithm.\",\n\t\"license_title\":
